import { Component, OnInit } from '@angular/core';
import { NavigationExtras, Router } from '@angular/router';
import { lastValueFrom } from 'rxjs';
import { ApiService } from 'src/app/services/api.service';
import { jsPDF } from 'jspdf';
import { File } from '@awesome-cordova-plugins//file/ngx';
import { FileOpener } from '@awesome-cordova-plugins//file-opener/ngx';
import { Platform } from '@ionic/angular'
import { DbService } from 'src/app/services/db.service';

@Component({
  selector: 'app-atencionespaciente',
  templateUrl: './atencionespaciente.page.html',
  styleUrls: ['./atencionespaciente.page.scss'],
})
export class AtencionespacientePage implements OnInit {

  login: boolean = false;
  idTipo: number = 0;
  idUsuario: number = 0;
  idPersona: number = 0;
  idPaciente: number = 0;
  correo: string = '';
  showProximaCitaEmptyMessage: boolean = false;
  showHistorialCitasEmptyMessage: boolean = false;
  loading: boolean = false;
  historialCitas: any[] = [];
  isAlertOpen = false;
  alertButtons = ['OK'];
  error_mensaje: any = '';

  constructor(private router: Router, private apiService: ApiService, private file: File, private fileOpener: FileOpener, private platform: Platform, private dbService: DbService) { }

  ngOnInit() {
    let parametros = this.router.getCurrentNavigation();
    if (parametros?.extras.state) {
      this.idTipo = parametros?.extras.state['idTipo'];
      this.idPaciente = parametros?.extras.state['idPaciente'];
      this.idUsuario = parametros?.extras.state['idUsuario'];
      this.login = parametros?.extras.state['login'];
      this.correo = parametros?.extras.state['correo'];
      this.idPersona = parametros?.extras.state['idPersona'];
    }
    this.obtenerDetallesCitas();

  }

  generarPDF(cita: any) {
    const doc = new jsPDF();
    const margin = 20; // 2 cm en puntos

    const signatureImage = "data:image/png;base64,"

    doc.setFontSize(14);
    doc.setFont('times', 'bold');
    doc.text('Informe Psicológico', 80, 15);

    doc.setFontSize(11);
    doc.text('1. Datos del Paciente', margin, 30);
    doc.setFontSize(11);
    doc.setFont('times', 'normal');
    doc.text(`Nombre: ${cita.nombre_paciente}`, margin, 40);
    doc.text(`Rut: ${cita.rut_paciente}`, margin, 50);
    doc.text(`Fecha de Nacimiento: ${cita.FechaNacimiento}`, margin, 60);
    doc.text(`Edad: ${cita.Edad}`, margin, 70);

    doc.setFontSize(11);
    doc.setFont('times', 'bold');
    doc.text('2. Detalles de la Cita', margin, 80);
    doc.setFont('times', 'normal');
    doc.setFontSize(11);
    doc.text(`Psicólogo: ${cita.nombre_psicologo}`, margin, 90);
    doc.text(`Fecha: ${cita.fecha}`, margin, 100);
    doc.text(`Hora: ${cita.hora}`, margin, 110);

    doc.setFontSize(11);
    doc.setFont('times', 'bold');
    doc.text('3. Observaciones', margin, 120);
    doc.setFontSize(11);
    doc.setFont('times', 'normal');
    const splitDiagnostico = doc.splitTextToSize(`Diagnóstico: ${cita.Diagnostico}`, 170); // Adjusted for margins
    doc.text(splitDiagnostico, margin, 130);
    const splitTratamiento = doc.splitTextToSize(`Tratamiento: ${cita.Tratamiento}`, 170); // Adjusted for margins
    doc.text(splitTratamiento, margin, 140);

    const finalY = 200 + (splitDiagnostico.length + splitTratamiento.length) * 10;
    doc.addImage(signatureImage, 'PNG', margin, finalY, 50, 20, '', 'FAST'); // Usa compresión 'FAST'
    doc.text(cita.nombre_psicologo, margin, finalY + 30);
    doc.text('Psicólogo', margin, finalY + 40);
    doc.text(this.formatDate(new Date()), margin, finalY + 50);

    const pdfOutput = doc.output();
    const buffer = new ArrayBuffer(pdfOutput.length);
    const array = new Uint8Array(buffer);
    for (let i = 0; i < pdfOutput.length; i++) {
      array[i] = pdfOutput.charCodeAt(i);
    }

    const fileName = `Informe_${cita.nombre_paciente}_${cita.fecha}.pdf`;

    if (this.platform.is('cordova')) {
      this.file.writeFile(this.file.dataDirectory, fileName, buffer, { replace: true }).then(fileEntry => {
        this.fileOpener.open(fileEntry.nativeURL, 'application/pdf');
      }).catch(error => {
        console.error('Error writing file', error);
      });
    } else {
      const blob = new Blob([buffer], { type: 'application/pdf' });
      const url = URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = fileName;
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
    }
  }

  async obtenerDetallesCitas() {
    const IdPaciente = this.idPaciente;
    try {
      const data = this.apiService.obtenerDetallesCitas(IdPaciente);
      const respuesta = await lastValueFrom(data);
      this.historialCitas = Array.isArray(respuesta) ? respuesta : [];
      if (this.historialCitas.length === 0) {
        this.showHistorialCitasEmptyMessage = true;
      } else {
        this.showHistorialCitasEmptyMessage = false;
      }
    } catch (error) {
      this.showHistorialCitasEmptyMessage = true;
      this.isAlertOpen = true;
      this.error_mensaje = 'Error al obtener detalles de citas';
      console.error('Error al obtener detalles de citas', error);
    }
  }

  goHome() {
    if (this.login) {
      let parametros: NavigationExtras = {
        state: {
          login: this.login,
          idPaciente: this.idPaciente,
          correo: this.correo,
          idUsuario: this.idUsuario,
          idTipo: this.idTipo,
          idPersona: this.idPersona
        },
        replaceUrl: true
      }
      this.router.navigate(['cliente'], parametros);
    } else {
      let parametros: NavigationExtras = {
        replaceUrl: true
      }
      this.router.navigate(['home'], parametros);
    }
  }

  goSoporte () {
    let parametros: NavigationExtras = {
      state: {
        login: this.login,
        idPaciente: this.idPaciente,
        correo: this.correo,
        idUsuario: this.idUsuario,
        idTipo: this.idTipo,
        idPersona: this.idPersona
      },
      replaceUrl: true
    }
    this.router.navigate(['soportepaciente'], parametros);
  }

  logout() {
    this.dbService.limpiarTablaUsuario();
    this.login = false;
    let parametros: NavigationExtras = {
      state: {
        login: this.login
      },
      replaceUrl: true
    }
    this.router.navigate(['home'], parametros);
  }

  goHistorial() {
    console.log('Login: ', this.login)
    let parametros: NavigationExtras = {
      state: {
        login: this.login,
        idPaciente: this.idPaciente,
        correo: this.correo,
        idUsuario: this.idUsuario,
        idTipo: this.idTipo,
        idPersona: this.idPersona
      },
      replaceUrl: true
    }
    this.router.navigate(['atencionespaciente'], parametros);
  }

  goEditar () {
    let parametros: NavigationExtras = {
      state: {
        login: this.login,
        idPaciente: this.idPaciente,
        correo: this.correo,
        idUsuario: this.idUsuario,
        idTipo: this.idTipo,
        idPersona: this.idPersona
      },
      replaceUrl: true
    }
    this.router.navigate(['editarpaciente'], parametros);
  }

  formatDate(date: Date): string {
    const day = date.getDate().toString().padStart(2, '0');
    const month = (date.getMonth() + 1).toString().padStart(2, '0');
    const year = date.getFullYear();
    return `${day}-${month}-${year}`;
  }
}
